    false,nt"url": null,nt"notes": "This part of SIM 3319 presents data for
    the bathymetry and shaded-relief maps (see sheets 1, 2, SIM 3319) of the Offshore
    of Refugio Beach map area, California. The raster data file for the bathymetry map
    is included in "Bathymetry_OffshoreRefugioBeach.zip," which is accessible from
    http://pubs.usgs.gov/ds/781/OffshoreRefugioBeach/data_catalog_OffshoreRefugioBeach.html.
    The bathymetry and shaded-relief maps of Offshore of Refugio Beach Area, California,
    were generated from bathymetry data collected by the U.S. Geological Survey (USGS),
    and by Fugro Pelagos, for the U.S. Army Corps of Engineers (USACE) Joint Lidar Bathymetry
    Technical Center of Expertise. The offshore region was mapped by the USGS in 2008,
    using a 234.5-kHz SEA (AP) Ltd. SWATHplus-M phase-differencing sidescan sonar. The
    nearshore bathymetry and coastal topography were mapped for USACE by Fugro Pelagos
    in 2009, using the SHOALS-1000T bathymetric-lidar and Leica ALS60 topographic-lidar
    systems. All these mapping missions combined to collect bathymetry from the 0-m
    isobath to beyond the 3-nautical-mile limit of Californiau0104s State Waters.",nt"license_title":
